import adapter from './adapter'

var streamsList = [
{name: "netflix"},
{name: "hulu"},
{name: "amazon"},
{name: "hbo"},
{name: "disney"},
{name: "showtime"}];


class Streams{
	constructor(name){
		this.name = name;
	}

}


adapter.getStreams()
.then(streams => retireveStreams(streams))


 function retireveStreams(list){
  	streamsList = list.map(stream=> {
    	return new Streams(stream.name);
  	});

  	console.log(streamsList);
  	return streamsList
 }


export default streamsList
